        if (data && Array.isArray(data) && Array.isArray(data[0]) && data[0].length < 2)
            throw new RangeError('Must include at least two columns, the first column must be the dependent variable, followed by independent variables');
        // let n_vars = data[ 0 ].length;
        let cols = [];
        // let names = [];
        // input sequence (t-n, ... t-1)
        for (let x in data) {
            //@ts-ignore
            x = Number(parseInt(x));
            //@ts-ignore
            let maxIndex = x + n_in + n_out;
            if (maxIndex > data.length)
                break;
            //@ts-ignore
            cols[x] = [];
            // console.log({ x,maxIndex });
            for (let i in range(n_in)) {
                //@ts-ignore
                i = parseInt(i);
                //@ts-ignore
                cols[x].push(...data[x + i]);
                // console.log({ i, cols, });
            }
            for (let j in range(n_out)) {
                //@ts-ignore
                j = parseInt(j);
                //@ts-ignore
                cols[x].push(...data[x + j + n_in]);
                // console.log({ j, cols, });
            }
        }
